import Home from './Components/Pages/Home';
import About from './Components/Pages/About';
import Anime from './Components/Pages/Anime';
import Contact from './Components/Pages/Contact';
import Login from './Components/Pages/Login';
import Traditional from './Components/Pages/Traditional';
import Warli from './Components/Pages/Warli';
import Categories from './Components/Pages/Categories';
import Registration from './Components/Pages/Registration';
import ReactDOM from "react-dom/client";
import{
  Routes,

  Route
} from "react-router-dom";

function App() {
  return (

      <Routes>
        <Route path='/' Component={Home}></Route>
        <Route path='/About' Component={About}></Route>
        <Route path='/Anime' Component={Anime}></Route>
        <Route path='/Contact' Component={Contact}></Route>
        <Route path='/Categories' Component={Categories}></Route>
        <Route path='/Login' Component={Login}></Route>
        <Route path='/Registration' Component={Registration}></Route>
        <Route path='/Traditional' Component={Traditional}></Route>
        <Route path='/Warli' Component={Warli}></Route>
      </Routes>

  );
}

export default App;
